import React from 'react';
import Button from '@mui/material/Button';
import { Link } from "react-router-dom";
import '../App.css'; 


const Home = () => {
    return <div>
        <p>
            Welcome to GatorLingo
        </p>
        <Button variant="contained">
            <Link to="/student-login" class="a">Student Login</Link>
        </Button>
        <Button variant="contained">
            <Link to="/professor-login" class="a">Professor Login</Link>
        </Button>
    </div>
  };

  export default Home;
